import React from 'react'
import'../styles/_navbar.scss';
import logo from '../assests/06.png';

function topbar() {
    return (
        <div className="navbar">
            <img src={logo} className="navbar__logo" alt="logo" />
            <div className="navbar__container">
                <ul className="navbar__subcontainer">
                    <li className="navbar__list">Home</li>
                    <li className="navbar__list">About</li>
                    <li className="navbar__list">Work</li>
                    <li className="navbar__list">Contact</li>
            </ul>
            </div>
            
        </div>
    )
}

export default topbar
